import React from 'react';
import jquery from 'jquery';

class NavbarComponent extends React.Component {

    render() {
        return(
        <div className="navbar">
		    <div className="btnMenu" onClick="hamburgerMenu();">
                <span className="line menuLn1"></span>
                <span className="line menuLn2"></span>
                <span className="line menuLn3"></span>
		    </div>
		    <img id="logo" src="./index_files/Official_Alumni_Association_Logo_11-17-20.png"/>
        </div>
        )
    }
}
export default NavbarComponent;
